.header {
  min-height: 48px;
  display: flex;
  justify-content: space-between;
  align-items: center;

  &__logo-icon {
    transition: transform 0.3s;

    &:hover {
      transform: scale(1.2);
      transition: transform 0.3s;
    }
  }

  &__actions {
    align-items: center;

    &-close {
      transition: transform 0.3s;

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }

    &-specs {
      font-size: 14px;
      font-weight: 300;
      margin-right: 20px;
      color: $slateGray;
      text-transform: uppercase;

      &:hover {
        color: black;
        font-weight: 400;
      }

      &::before {
        display: block;
        content: attr(data-text);
        font-weight: 400;
        height: 0;
        overflow: hidden;
        visibility: hidden;
      }
    }

    &-lang {
      &-en,
      &-separator {
        color: $darkestGray;
        font-size: 14px;
        font-weight: 400;
        line-height: 18px;
      }

      &-separator {
        margin: 0 3px;
      }

      &-ua {
        color: $mediumGray;
        font-size: 14px;
        font-weight: 300;
        line-height: 18px;

        &:hover {
          color: black;
          font-weight: 400;
        }
      }
    }

    &-buy {
      display: flex;
      border: none;
      width: 100px;
      height: 48px;
      background-color: $darkestGray;
      color: #fff;
      font-size: 12px;
      font-weight: 500;
      justify-content: center;
      align-items: center;
      text-transform: uppercase;

      &--menu {
        display: block;
        width: 100%;
      }

      &:hover {
        background-color: $richBlack;
      }
    }

    &-menu {
      display: block;
      width: 32px;
      height: 32px;
      background-image: url("../images/icons/burger-menu.svg");
      transition: transform 0.3s;

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }

    &-close {
      display: block;
      width: 24px;
      height: 24px;
      background-image: url("../images/icons/close.svg");
    }
  }
}

sources.styles/blocks/_aside.scss:
.menu {
  @include pagePadding;
  display: flex;
  flex-direction: column;
  row-gap: 0;
  height: 100vh;
  background-color: $lightestGray;
  position: fixed;
  overflow: auto;
  top: 0;
  left: 0;
  right: 0;
  opacity: 0;
  pointer-events: none;
  text-transform: uppercase;
  transition: all 0.3s;
  &-header {
    height: 48px;
  }

  &__list {
    display: flex;
    flex-direction: column;
    gap: 25px;
  }

  &__content {
    margin-top: 55px;
    height: inherit;

    &-text {
      @extend %quote-mobile;
      font-weight: 400;
      text-transform: uppercase;
      text-decoration: none;
      cursor: pointer;
      text-align: center;

      &:visited {
        color: black;
      }

      &:hover {
        font-weight: 700;
      }

      &::before {
        display: block;
        content: attr(data-text);
        font-weight: 700;
        height: 0;
        overflow: hidden;
        visibility: hidden;
      }
    }
  }

  &__buy-button{
    display: flex;
    height: 48px;
    width: 100%;
  }

  &:target {
    opacity: 1;
    pointer-events: all;
    transition: all 0.3s;
  }
}

.header__actions{
  &--menu {
    margin-top: 50px;

  }
}

@include onTablet {
  .menu__buy-button,
  .menu__list-lang{
    display: none;
  }
}

sources.styles/blocks/_nav.scss:
.nav__list-menu {
  display: none;
}
.nav {
    display: flex;
    gap: 30px;

    &__list {
      display: flex;
      list-style: none;

      &::after {
        content: attr(data-text);
        content: attr(data-text) / "";
        height: 0;
        visibility: hidden;
        overflow: hidden;
        user-select: none;
        pointer-events: none;
        @media speech {
          display: none;
        }
      }

      &-spec,
      &-lang,
      &-buy {
        display: none;
      }
    }

    &__item {
      list-style: none;
    }

    &--menu {
      align-items: flex-start;
      flex-direction: column;
      gap: 50px;
    }

    &__menu-lang {
      display: flex;
    }
}

@include onTablet {
  .nav__list {
    &-spec,
    &-lang,
    &-buy {
      display: flex;
    }
  }

}

@include onDesktop {
  .nav__list-menu {
    display: none;
  }
}

