sources.styles/blocks/_footer.scss:
.footer {
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 110px;

  &-logo,
  &-arrow {
    display: none;
  }

  &__logo-icon:hover {
    transform: scale(1.2);
    transition: transform 0.3s;
  }

  &__container {
    display: flex;
    gap: 40px;
    margin-bottom: 20px;

    &-icon {
      width: 24px;
      height: 24px;
      transition: transform 0.3s;

      &--fb {
        background: url(../images/icons/social/fb.svg);
      }

      &--x {
        background: url(../images/icons/social/x.svg);
      }

      &--inst {
        background: url(../images/icons/social/inst.svg);
      }

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }
  }

  &-terms {
    @extend %secondary-text;
    color: $lightGray;
  }
}

@include onTablet {
  .footer {
    margin-top: 140px;

    &-logo,
    &-arrow {
      display: block;

    }

    &-arrow {
      display: flex;
      align-self: flex-end;
      width: 50px;
      height: 50px;
      position: absolute;
      background: url(../images/icons/arrow-top.svg);
      transition: transform 0.3s;

      &:hover {
        transform: scale(1.2);
        transition: transform 0.3s;
      }
    }

    &__container {
      margin-top: 60px;
      margin-bottom: 60px;
      gap: 50px;
    }
  }
}

@include onDesktop {
  .footer {
    margin-top: 170px;
  }
}
